//              "textDisplay": "It is true that credit card transactions are higher, on average, than cash transactions. You know what else is true? Poorer people mostly use cash, and richer people mostly use credit cards. I think there&#39;s another explanation here other than people don&#39;t understand that money is real...\u003cbr\u003e\u003cbr\u003eLikewise, it is true that student debt is a huge issue, and that young people have an alarming rate of bankruptcy. Something tells me that these two things might be related, and its absurd to suggest that student loans are a problem merely because kids don&#39;t understand what money is. They&#39;re told that the best thing they can do for their future is get a good education, and schools are happy to charge obscene tuition to provide it. How can we blame kids for doing what we tell them?\u003cbr\u003e\u003cbr\u003eIt&#39;s absurd to suggest that the problem with student loans is the use of credit cards.\u003cbr\u003e\u003cbr\u003eThere are real issues with microtransactions in games and apps. The problem is that those apps are designed to get people to pay as much as possible by being designed to be frustrating to use unless you pay. They use psychological tactics to get people to spend that go way beyond using digital currency, and those tactics are particularly effective on kids and those with mental disabilities. Thing is, those tactics don&#39;t even work on most users. The majority of in-app purchases come from a minority of users, the &quot;whales,&quot; who again are more likely to have some form of disability. If it were genuinely a problem of financial literacy or digital currency use, you&#39;d expect in-app purchases to be more evenly distributed. Or, alternatively, if the problem of financial literacy were a wide-spread problem, you&#39;d expect in-app purchases to affect most users rather than a small portion.",
//              "textOriginal": "It is true that credit card transactions are higher, on average, than cash transactions. You know what else is true? Poorer people mostly use cash, and richer people mostly use credit cards. I think there's another explanation here other than people don't understand that money is real...\n\nLikewise, it is true that student debt is a huge issue, and that young people have an alarming rate of bankruptcy. Something tells me that these two things might be related, and its absurd to suggest that student loans are a problem merely because kids don't understand what money is. They're told that the best thing they can do for their future is get a good education, and schools are happy to charge obscene tuition to provide it. How can we blame kids for doing what we tell them?\n\nIt's absurd to suggest that the problem with student loans is the use of credit cards.\n\nThere are real issues with microtransactions in games and apps. The problem is that those apps are designed to get people to pay as much as possible by being designed to be frustrating to use unless you pay. They use psychological tactics to get people to spend that go way beyond using digital currency, and those tactics are particularly effective on kids and those with mental disabilities. Thing is, those tactics don't even work on most users. The majority of in-app purchases come from a minority of users, the \"whales,\" who again are more likely to have some form of disability. If it were genuinely a problem of financial literacy or digital currency use, you'd expect in-app purchases to be more evenly distributed. Or, alternatively, if the problem of financial literacy were a wide-spread problem, you'd expect in-app purchases to affect most users rather than a small portion.",
